import { Component, Input, OnInit } from '@angular/core';
import { TransformProps } from '@stitches/core/types/styled-component';
import { VenusButtonStyle } from './venus-button.styles';

@Component({
  selector: 'venus-button',
  template: `
    <button [ngClass]="[style]" [disabled]="isDisabled" [type]="type">
      <ng-content></ng-content>
    </button>
  `,
  styles: [],
})
export class VenusButtonComponent implements OnInit {
  @Input() type: 'button' | 'reset' | 'submit' = 'button';
  @Input() variant: 'primary' | 'secondary' | 'danger' | 'warning' | 'success' =
    'primary';
  @Input() full: boolean = false;
  @Input() isDisabled: boolean = false;
  style: string = '';

  ngOnInit(): void {
    let props: TransformProps<
      {
        bg?:
          | 'primary'
          | 'secondary'
          | 'danger'
          | 'warning'
          | 'success'
          | undefined;
        size?: 'full' | undefined;
      },
      {}
    > = { bg: this.variant };
    if (this.full) {
      props.size = 'full';
    }

    this.style = VenusButtonStyle(props).className;
  }
}

import { Component, Input, OnInit } from '@angular/core';
import {
  VenusCardStyle,
  VenusCardHeader,
  VenusCardSection,
} from './venus-card.styles';

@Component({
  selector: 'venus-card',
  template: `
    <article [ngClass]="[style]">
      <header [ngClass]="[header]">
        <ng-content select="[card_header]"></ng-content>
      </header>
      <section [ngClass]="[section]">
        <ng-content select="[card_section]"></ng-content>
      </section>
    </article>
  `,
  styles: [],
})
export class VenusCardComponent implements OnInit {
  style: string = '';
  header: string = '';
  section: string = '';

  @Input() variant: 'default' | 'full' = 'default';

  ngOnInit(): void {
    this.header = VenusCardHeader().className;
    this.section = VenusCardSection().className;
    if (this.variant == 'full') {
      this.style = VenusCardStyle({ size: 'full' }).className;
      return;
    }
    this.style = VenusCardStyle().className;
  }
}

import { Component, Input, OnInit } from '@angular/core';
import { VenusInputStyle } from './venus-input.styles';

@Component({
  selector: 'venus-input',
  template: `
    <input
      [placeholder]="placeholder"
      [disabled]="isDisabled"
      [ngClass]="style"
      [name]="name"
      [type]="type"
      value=""
    />
  `,
  styles: [],
})
export class VenusInputComponent implements OnInit {
  @Input() type: 'text' | 'number' | 'password' = 'text';
  @Input() name: string = '';
  @Input() placeholder: string = '';
  @Input() isDisabled: boolean = false;
  style: string = '';

  ngOnInit() {
    this.style = VenusInputStyle().className;
  }
}

