        '&:hover': {
          backgroundColor: '$secondaryRegular',
          color: '$secondaryLow',
        },
        '&:disabled': {
          cursor: 'not-allowed',
          backgroundColor: '$gray',
          color: 'rgba(112, 112, 112, .5)',
        },
      },
      danger: {
        backgroundColor: '$danger',
        '&:hover': {
          backgroundColor: '$dangerHover',
        },
        '&:disabled': {
          cursor: 'not-allowed',
          backgroundColor: 'rgba(217, 67, 82, .5)',
          color: 'rgba(255, 255, 255, .5)',
        },
      },
      success: {
        backgroundColor: '$success',
        '&:hover': {
          backgroundColor: '$successHover',
        },
        '&:disabled': {
          cursor: 'not-allowed',
          backgroundColor: 'rgba(0, 179, 126, .5)',
          color: 'rgba(255, 255, 255, .5)',
        },
      },
      warning: {
        backgroundColor: '$warning',
        color: '$secondaryMid',
        '&:hover': {
          backgroundColor: '$warningHover',
        },
        '&:disabled': {
          cursor: 'not-allowed',
          backgroundColor: 'rgba(245, 185, 70, .5)',
          color: 'rgba(78, 74, 69, .5)',
        },
      },
    },
    size: {
      full: {
        width: '100%',
      },
    },
  },
})

css({
  fontWeight: '$bold',
  padding: '18px',
  fontSize: '$lg',
  borderBottom: '1px solid $secondaryRegular',
})

css({
  color: '$secondaryMid',
  backgroundColor: '$gray',
  border: 'none',
  borderRadius: '$lg',
  outline: 'none',
  width: '475px',
  variants: {
    size: {
      full: {
        width: '100%',
      },
    },
  },
})

css({
  height: '50px',
  fontSize: '$sm',
  color: '$secondaryMid',
  backgroundColor: '$secondaryLow',
  borderRadius: '$sm',
  border: '3px solid transparent',
  padding: '0 .7rem',
  transition: '.3s',
  outline: 'none',
  width: '100%',

  '&:focus': {
    border: '3px solid $primaryMid',
  },

  '&:disabled': {
    cursor: 'not-allowed',
    backgroundColor: '$gray',
    color: 'rgba(112, 112, 112, .5)',
  },
})

